import React from 'react';
import './App.css';
import Navbar from './Navbar';
import Main from './Main';
import {Routes, Route} from 'react-router-dom';

function App() {
  return (
    <div className="app">
      <div className="app__container">
        <Navbar/>
        <Main/>
        <Routes>
          <Route path="/"></Route>
        </Routes>
      </div>
    </div>
  );
}

export default App;
